import ReactDOM from "react-dom";

const App = () => {
    return <h1>こんにちは！</h1>;
};
const AppHello = () => {
    return <h2>hello</h2>
}

ReactDOM.render(<App />, document.getElementById("root"));
ReactDOM.render(<App />,document.getElementById("hello"));
